// Aspect ration should be at most 1.51:1
var div_height = Math.min(
    Math.max($('body').height() - 80, $('#flex-right').height()),
    $('#flex-left').width() * 1.51
);
var div_width = Math.min($('#flex-left').width(), (div_height)/1.51);

var svg = d3.select("#flex-left")
  .append("svg")
    .attr("viewBox", [0, 0, div_width, div_height * .98])
    .style('margin', 0)
    .style('padding', 0)
    .style('float', 'right')
    .attr('width', div_width)
    .attr('height', div_height)
    .attr("id", "map-graphic");

var x = d3.scaleLinear()
  .domain([ -3E5, 1.15E6 ])
  .range([0, div_width * .98]);
var y = d3.scaleLinear()
  .domain([ 3.3E6, 5.5E6 ])
  .range([div_height, 0]);

for(f_i = 0, len_f = rails.features.length; f_i < len_f; f_i++ ){
  var line_groups = rails.features[f_i].geometry.coordinates;
  for(lg_i = 0, len_lg = line_groups.length; lg_i < len_lg; lg_i++ ){
    var coords_arr = line_groups[lg_i]
    var coords_str = "";
    for(co_i = 0, len_co = coords_arr.length; co_i < len_co; co_i++ ){
      coords_str += " " + x(coords_arr[co_i][0]) + ',' + y(coords_arr[co_i][1]);
    }
    svg.append('polyline')
      .attr('points', coords_str)
      .attr('stroke', 'black')
      .attr('stroke-width', 0.3)
      .attr('fill', 'none');
  }
}
  

var city_dots = svg
  .append("g")
  .selectAll("dot")
  .data(cities.nodes)
  .enter()
  .append('circle')
    .attr("cx", function(d) { return x(d.long); } )
    .attr("cy", function(d) { return y(d.lat); } )
    .attr("r", 0.0 )
    .attr("fill-opacity", 0.5 )
    .attr("stroke-opacity", 1.0 )
    .style("fill", function(d) {
      return d3.interpolateYlGnBu( Math.min( .2 + (Math.cbrt(d.weight_viz) - 250)/1600, 1 ) ) 
    })
    .transition()
      .ease(d3.easeLinear)
      .delay( function(d, i) {return i * 5 } )
      .duration( function(d, i) { return 500 + Math.random() * 1500 } )
      .attr('r', function(d) { return Math.sqrt(d.weight_viz / 6E6) });


